import styled from "styled-components";
import { Link } from "react-router-dom";
import { Amazon_Logo } from "../../assets/Images";
import LocationOnOutlinedIcon from "@mui/icons-material/LocationOnOutlined";
import TopNavSearch from "./TopNavSearch";

const TopNav = () => {
  return (
    <TopNavContainer className="flex">
      <TopNavLeft>
        <Link to={"/"} className="nav__logo">
          <img src={Amazon_Logo} alt="Amazon Logo" />
        </Link>
      </TopNavLeft>
      <TopNavMiddle></TopNavMiddle>
      <TopNavRight></TopNavRight>
    </TopNavContainer>
  );
};

export default TopNav;

const TopNavContainer = styled.nav`
  align-items: center;
  background-color: rgb(14, 12, 41);
  padding: 0.4rem 0.8rem;
`;
const TopNavLeft = styled.nav`
  .nav__logo {
    width: 7rem;
    height: 2.4rem;

    img {
      width: inherit;
      height: inherit;
    }
  }
`;
const TopNavMiddle = styled.nav``;
const TopNavRight = styled.nav``;
